import React from 'react';
import ReactDOM from 'react-dom/client';
import App from './App';
import BgChanger from "./BgChanger"
import style from "./style.css"

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
    <div className={style}>
    <App />
    <BgChanger />
    </div>
);
